import {
    HStack,
    Tag,
    TagLabel,
    TagCloseButton
} from '@chakra-ui/react'

export default function Filter(props: any) {
    return (
        <>
            <HStack spacing={4}>
            {['Dress', 'Jacket', 'Top', 'Pants', 'Shorts', 'Skirt', 'Sweater', 'Shoe'].map((type) => (
                <Tag
                size='lg'
                key={type}
                borderRadius='full'
                variant='solid'
                colorScheme='telegram'
                >
                <TagLabel>{type}</TagLabel>
                <TagCloseButton />
                </Tag>
            ))}
            </HStack>
        </>
    )
}
